import React, { useEffect } from 'react'
import '../navigation.css'
import Button from './Button'

export default function NavBar(props) {

  useEffect (() => {
    console.log(props.pressed)
  })

  return (
    <div className='navbar'>
        <div className="mainIcon"></div>
        <Button text={"FAQ"} class={`button ${props.pressed==this.text ? 'pressedBtn' : null}`}/>
        <Button text={"Explore creators"} class={"button"}/>
        <div className="rightButtons">
        <Button text={"Login"} class={"button"}/>
        <Button text={"Sign Up"} class={"buttonBright"}/>
        </div>

    </div>
  )
}
